DROP TABLE IF EXISTS "dublinpublictoilets" CASCADE;
CREATE TABLE "dublinpublictoilets" ( "ogc_fid" SERIAL PRIMARY KEY NOT NULL,
"tgeom" GEOMETRY DEFAULT ST_GEOMFROMTEXT('point(-23.5 56.3)',4326),
"id" VARCHAR,
"amenity" VARCHAR
);

CREATE INDEX "dublinpublictoilets_tgeom_geom_idx" ON "dublinpublictoilets" USING GIST ("tgeom");


